column8:
• Материал: буй изготовлен из поливинилхлорида (ПВХ), флажок - из нейлона;
• цветовая гамма: оранжево-красный;
• съёмный флажок на флагштоке;
• 25 метров нейлонового буйрепа с двумя карабинами;
• 4 дополнительных места крепления аксессуаров.

Может служить основой любой системы. Разработанная профессиональными дайверами, спинка может использоваться как с подвесной системой WTX, так и отдельно.
- изготовлена из высококачественной нержавеющей стали;
- вес около 2,2 кг;
- 4 продольных отверстия сверху и столько же снизу для продевания баллонного ремня (в случае использования одного баллона) позволяют надежно прикрепить одиночный баллон прямо к спинке. (Для большего удобства рекомендуется использовать адаптор под один баллон). Наличие 4 отверстий обеспечивает более стабильную и надежную фиксацию баллона по сравнению с двумя стандартными отверстиями;

Самая универсальная подвесная система. Прочная конструкция, выполненная из износостойких материалов, дает возможность сделать эту подвесную систему основой для различных конфигураций.
- может использоваться с одним баллоном (крепление с помощью двух ремней);
- может использоваться совместно со стальной спинной пластиной Apeks для закрепления тяжелой стальной спарки;
- отверстия в поясном ремне позволяют легко подсоединять грузовую систему “SureLock™”;
- конструкция подвесной системы, оставляющая свободными плечи и бока дайвера, позволяет легко монтировать и демонтировать любые дополнительные устройства;
- выполнена из прочной кордуры 1000 D;

