Срок службы лампы составляет более 5000 часов!
Два режима работы с полной и половинной нагрузкой позволяют увеличить время свечения фонаря почти вдвое на одном комплекте батарей;
Комплектуется 4-мя алкалиновыми батареями или аккумуляторами NiCad (NiNH);
Электронная система управления позволяет обеспечить постоянство яркости свечения на протяжении всего времени работы от аккумуляторов;
Переключатель режимов работы снабжен фиксатором для предотвращения случайного включения;
Передняя часть фонаря защищена от мелких механических повреждений резиновым кожухом;
Корпус выполнен из высокопрочных ABS пластиков и поликарбоната;
Рукоятка пистолетного типа укомплектована предохранительной петлёй на руку с резиновой накладкой

Октопус, обладающий всеми характеристиками второй ступени Helix Pro. 
ОСОБЕННОСТИ:
Пневматически сбалансированный механизм;
Встроенный теплообменник;
Регулируемая заслонка Вентури;
Подходит для холодной воды.

Большое панорамное стекло и качественный мягкий силикон маски Marlin Frameless (Марлин Фреймлес) сделаны таким образом, чтобы обеспечить максимальный обзор и сохранить минимальное подмасочное пространство. Удобный мягкий ремешок позволит Вам быстро отрегулировать маску. Благодаря этому маска Marlin Frameless является универсальной, она идеально подойдет как для дайвинга, так и для подводной охоты.  
- высококачественный силикон;
- маленький подмасочный объем;
- удобные вращающиеся застежки;
- закаленное стекло;
- пластиковый бокс в комплекте.

Ткань TRAINING - максимально долговечная, идеально держит форму, на 100% устойчива к хлору и соленой воде, быстро сохнет;
Низкая посадка - обеспечивает комфорт и максимальную свободу движений;
