Комплект Neck Tite предназначен для быстрой установки и смены шейных манжет сухого гидрокостюма. К системе подходят как силиконовые (оптимально, штатно), так и некоторые, годные по размеру, латексные манжеты.
Комплект включает в себя:
вклеиваемое в гидрокостюм посадочное шейное кольцо (внешний диаметр 280 мм, внутренний 215 мм);
стопорное зажимное кольцо;
инструмент для установки кольца.

