Может служить основой любой системы. Разработанная профессиональными дайверами, спинка может использоваться как с подвесной системой WTX, так и отдельно.
- изготовлена из высококачественного анодированного алюминия;
- вес около 0,6 кг – прекрасно подходит для любителей путешествий;
- 4 продольных отверстия сверху и столько же снизу для продевания баллонного ремня (в случае использования одного баллона) позволяют надежно прикрепить одиночный баллон прямо к спинке. (Для большего удобства рекомендуется использовать адаптор под один баллон). Наличие 4 отверстий обеспечивает более стабильную и надежную фиксацию баллона по сравнению с двумя стандартными отверстиями;

Эта камера предназначена для использования со спаркой и обеспечивает 27 кг подъемной силы.
- внешняя оболочка камеры выполнена из усиленной кордуры для предотвращения истирания и повреждений камеры 

- сама внутренняя камера выполнена из прочного материала, созданного по стандартам и требованиям военной промышленности. Такой же материал используется в спасательных жилетах летчиков-истребителей ВВС США;
- внутренняя сменная камера защищена от контактов с застежкой-молнией резиновой вставкой с рельефной поверхностью;

Крыло для использования с одним баллоном, которое может быть закреплено на подвесной системе WTX или на жесткой спинке с моностропой.
- объем камеры позволяет при полном ее заполнении обеспечивать 14 кг подъемной силы;
- 4 продольных отверстия на камере позволяют закрепить ее на подвесной системе WTX или на жесткой спинке с помощью ремней крепления баллона;
- две пары отверстий позволяют установить WTX3 в фиксированном положении, при использовании одного баллона;

